    const underline = () => {(!link_home.isActive ? "nav-active" : "")



    }
    return (
        <div className='navbar_container'>
            <div className='logo_container'>
                <img className='logo' src={logo} alt="Kasa"  />    
            </div>
            <nav>
                <Link to='/' className='navbar_link link_1' onClick={underline}>Accueil</Link>
                <Link to='/About' className='navbar_link link_2' onClick={underline}>A propos</Link>
            </nav>
        </div>
    )
}

